import React from "react";
import AddIcon from "@mui/icons-material/Add";
import styled from "styled-components";

const Button = styled.button`
  border-radius: 15px;
  padding: 19px 25px;
`;

const Watchlist = () => {
  return (
    <div>
      <AddIcon
        sx={{ zIndex: 11, position: "absolute", left: 20, bottom: 21 }}
      />
    </div>
  );
};

export default Watchlist;
